import React, { Component } from 'react';
import '../Styles/dashboard.css';

export default class dashboard extends Component {
constructor(props) {
    super(props)

    this.state = {
         ...JSON.parse(localStorage.getItem("userData"))
    }
}

    render() {
        return (
            <div className='dashboard-div'>
                <div className="welcome-message-div"><h1 className="welcome-message">Hello!  {this.state.firstName} {this.state.lastName}, Welcome to FarmFund.</h1></div>

                <div className="welcome-message-div"><h2 className="welcome-message">Hello!  {this.state.firstName} {this.state.lastName}, Welcome to FarmFund.</h2></div>
            </div>
        )
    }
}
